import React from "react";
import Navbar from "./components/Navbar/Navbar";
import { Routes, Route, Navigate } from "react-router-dom";
import Explore from "./components/pages/Explore/Explore";
import Recent from "./components/pages/Recent/Recent";
import TopArtists from "./components/pages/TopArtists/TopArtisits";
import TopTracks from "./components/pages/TopTracks/TopTracks";


const Home = ({ code }) => {


  // Render the different pages conditionally
  return (
    <div>
      <Navbar />
      <Routes>
        <Route path="/" element={<Navigate to='/explore' />} />
        <Route path="/explore" element={<Explore code={code} />} />
        <Route path="/recent" element={<Recent code={code} />} />
        <Route path="top-artists" element={<TopArtists code={code} />} />
        <Route path="/top-tracks" element={<TopTracks code={code} />} />
      </Routes>
    </div>
  );
};

export default Home;
